  BrowserRouter,
  Link,
  Route,
  Routes,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
  },
  {
    path: "/login",
    element: <Test />,
  },
]);

function App() {
  return (
    <div style={{background:"#223"}}>
      <NavBar />
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<FicheUser />} />
          <Route path="/users/*" element={<UserApp />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
